import './App.css';
import React, { useState } from 'react';



function App() {
    const [visible, setVisible] = useState(false);

	let elem;
	if (visible) {
		elem = <p>text</p>;
	}

	return <div>
		<button onClick={() => setVisible(!visible)}>
			{visible ? 'hide' : 'show'}
		</button>
		{elem}
	</div>;

}

export default App;
